import { useTheme } from '@table-library/react-table-library/theme';
import { getTheme } from '@table-library/react-table-library/baseline';
import { StandingsTeam } from "../../../Data/Models/StandingsTeam";
import { Column, CompactTable } from '@table-library/react-table-library/compact';
import * as React from 'react';
import { TableNode } from '@table-library/react-table-library';

interface LandingPageStandingTableProps{
    standingsData:StandingsTeam[],
}
export default function LandingPageStandingsTable({standingsData}:LandingPageStandingTableProps){
    const theme = useTheme(getTheme());
    const COLUMNS= [
        {label: '#', renderCell:(item:any)=>item.conferenceStandingsPlace},
        {label: 'Team', renderCell:(item:any)=>item.teamName},
        {label: 'W', renderCell:(item:any)=>item.wins},
        {label: 'L', renderCell:(item:any)=>item.losses},
        {label: 'OT', renderCell:(item:any)=> item.otLosses},
        {label: 'Record', renderCell:(item:any)=>item.record},
        {label:'P', renderCell:(item:any)=>item.points},
        {label:'P%', renderCell:(item:any)=>item.pointsPercentage},
    ];
    const data = [
        {
            "#":0,
            "Team":"",
            "W":0,
            "L":0,
            "OT":0,
            "Record":"0-0-0",
            "P":0,
            "P%":0.00,
        }
    ]
    return (
        <CompactTable columns={COLUMNS} data={data} theme={theme}/>
    )
}
